const vars = [
    {text:'happy'},
    {text:'welcome'},
    {text:'playing'},
    {text:'just go'}
]

const Tasks = () => {
  return (
    <>
      {vars.map(item => (
        <h1>{item.text}</h1>
      ))}
    </>
  )
}

export default Tasks
